import React from 'react'
import { makeStyles } from '@material-ui/core/styles';



const useStyles=makeStyles(theme=>({



img:{
    width:"100%",
    cursor:"pointer"
},
root:{
    flexGrow: 1,
}



}))

const Gallery = () => {
    const classes=useStyles()
    return (
        <>
       <div className={classes.imgGallery}>

           <Grid container className={classes.root} >

               <Grid item md={3} style={{width:"250px"}} >
               <img src={ process.env.PUBLIC_URL + '/images/r1.jpg'} className={classes.img}  alt="" />

                   </Grid>


               </Grid>


       <img src={ process.env.PUBLIC_URL + '/images/r2.jpg'} className={classes.img}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r3.jpg' } className={classes.img}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r4.jpg'} className={classes.img}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r5.jpg'} className={classes.img}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r6.jpg'}  className={classes.img} alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r7.jpg'} className={classes.img}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r8.jpg'} className={classes.img}  alt="" />



           </div>        




        </>
    )
}

export default Gallery
